function Profile (){
    return(
        <div className="Profile">
            <div>
                <div>
                    <img style={{width:"160px",width:"160px", borderRadious:"80px"}} src="https://pbs.twimg.com/media/Ez5yIwsVUAcW-U0.jpg:large" />
                </div>
                <div></div>
            </div>
        </div>       
    );
}

export default Profile;
